import React from "react";
import Navigation from "../components/Navigation";
import Hero from "../components/Hero";

const Home = () => {
  return (
    <div>
      <Navigation />
      <Hero
        image="path/to/your/custom/image.jpg"
        altText="Your custom alt text"
        title="Your custom title"
        redText="test"
        className="custom-hero-class" // Optional custom class name
      />

      <Hero />
    </div>
  );
};

export default Home;
